class Solution:
    def nearestExit(self, maze, entrance) -> int:
        moves = [entrance]
        step = 0
        n = len(maze)
        m = len(maze[0])
        while moves:
            cur_moves = len(moves)
            for i in range(cur_moves):
                (r,c) = moves.pop(0)
                maze[r][c] = '+'
                if (r == 0 or r == n - 1 or c == 0 or c == m - 1) and [r,c] != entrance:
                    return step
                for dr,dc in [[0,1],[0,-1],[1,0],[-1,0]]:
                    nr = r + dr
                    nc = c + dc
                    if 0 <= nr < n and 0 <= nc < m and maze[nr][nc] == '.':
                        moves.append([nr,nc])
            step += 1
        return -1


